import logo from "./logo.svg";
import "./App.css";
import Header from "./components/Header";
import Home from "./components/Home";
import Search from "./components/Search";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
    return (
        <div className="App ">
            <Router>
                <Header></Header>
                <Home></Home>
            </Router>
        </div>
    );
}

export default App;
